sys_variable_value.value:
(function execute(inputs, outputs) {


  new azureComputeUtils().postErrorHandling(inputs, outputs);
  var responseBody = JSON.parse(inputs['responseBody']);
  var sizeList =[];
  var data =[];
  var sizes = responseBody.value;
  sizes.forEach(function(property){
    sizeList.push({
      label:property['name'],
      name:property['name']

    });
  });

  outputs.avaiablesizes = {data:sizeList};
})(inputs, outputs);

